<?php	require_once ("../lib/common/dao/VO.class.php");	class Groupstat extends VO {		private $organizationVO;		private $categoryVO;		private $timedimensionVO;		private $organizationid;		private $categoryid;		private $timeid;		private $statdata;		public function setOrganization($organizationVO){			$this->organizationVO=$organizationVO;		}		public function getOrganization(){			return $this->organizationVO;		}		public function setCategory($categoryVO){			$this->categoryVO=$categoryVO;		}		public function getCategory(){			return $this->categoryVO;		}		public function setTimedimension($timedimensionVO){			$this->timedimensionVO=$timedimensionVO;		}		public function getTimedimension(){			return $this->timedimensionVO;		}		public function setOrganizationid($organizationid){			$this->organizationid=$organizationid;		}		public function getOrganizationid(){			return $this->organizationid;		}		public function setCategoryid($categoryid){			$this->categoryid=$categoryid;		}		public function getCategoryid(){			return $this->categoryid;		}		public function setTimeid($timeid){			$this->timeid=$timeid;		}		public function getTimeid(){			return $this->timeid;		}		public function setStatdata($statdata){			$this->statdata=$statdata;		}		public function getStatdata(){			return $this->statdata;		}		public function __toString(){			return "organizationid=".$this->organizationid."(".$this->organizationVO.")".", categoryid=".$this->categoryid."(".$this->categoryVO.")".", timeid=".$this->timeid."(".$this->timedimensionVO.")".", statdata=".$this->statdata;		}	}?>